new Vue({el:"#activitiesSearch",data:{search:"",retirements:[{img:"img/activities/adult.svg",title:"Взрослое отделение",specialists:["Терапия","Гинекология","Ведение бременности","Гастроентерология","Урлогия"]},{img:"img/activities/adult.svg",title:"Детское отделение",specialists:["Педиатрия","Гинекология","Офтальмология"]}]},computed:{filteredRetirements:function(){var e=this;return this.retirements.filter(function(t){return t.title.toLowerCase().includes(e.search.toLowerCase())})}}});